package psp;

public class Resultat {
	private String numMachine;
	private String index;
	private String mode;
	private String changement;
	private String puissance;
	private String hauteurChute;

	public Resultat() {
		// TODO Auto-generated constructor stub
	}

	
	public String getChangement() {
		return changement;
	}

	public void setChangement(String changement) {
		this.changement = changement;
	}


	public String getIndex() {
		return index;
	}

	public void setIndex(String index) {
		this.index = index;
	}

	public String getMode() {
		return mode;
	}

	public void setMode(String mode) {
		this.mode = mode;
	}

	public String getPuissance() {
		return puissance;
	}

	public void setPuissance(String puissance) {
		this.puissance = puissance;
	}

	public String getHauteurChute() {
		return hauteurChute;
	}

	public void setHauteurChute(String hauteurChute) {
		this.hauteurChute = hauteurChute;
	}

	public String getNumMachine() {
		return numMachine;
	}

	public void setNumMachine(String numMachine) {
		this.numMachine = numMachine;
	}
	

	
	
}
